// import './Search.css'

 const Search = (props) => {
    //  console.log(props)
    return (
        
            <div className='search-right'>
            <img src={props.value.img}alt='' className='img'></img><br/>
              <b>Name: </b>{props.value.name}<br />
              <b>Location: </b>{props.value.location}<br />
              <b>size: </b>{props.value.size}<br />
              <b>price: </b>{props.value.price}

            </div>

    
       
    )
}
